"""
### Step 2:  **Import Libraries**


Import the required modules from the `llama_index` and `openai` libraries."""

from llama_index.core import SimpleDirectoryReader, VectorStoreIndex, StorageContext, Document
import openai

"""
#### Step 3. **Set Up OpenAI API Key**"""

# Set your OpenAI API key
import os
os.environ["OPENAI_API_KEY"] = "Your OpneAI API-KEY"

"""
### Step 4: **Load Documents**

For this example, let's assume you have a list of documents (`company_docs`) that you want to use for the chatbot. You can load these documents from a file or define them directly in the notebook."""

# Example documents
company_docs = [
    Document(text="Our company values integrity, innovation, and customer satisfaction."),
    Document(text="We strive to be leaders in the tech industry by fostering a culture of continuous improvement."),
    Document(text="Our mission is to deliver high-quality products that meet the needs of our customers.")
]

"""![Query (1).gif](data:image/gif;base64,)

#### Step 5. **Create an Index**

Create a `VectorStoreIndex` from the documents. This index will be used to query information during conversations.
"""

# Create an index from the documents
index = VectorStoreIndex.from_documents(company_docs)

"""
#### Step 6. **Query the Index with LLM**

Use the index to query information, and process the query with an LLM to generate a response."""

# Function to query the index and generate a response using LLM
def query_with_llm(query):
    # Invoke as_query_engine() to get a query engine
    query_engine = index.as_query_engine()
    # Now you can query using the query engine
    index_response = query_engine.query(query)

    # Use LLM to generate a response
    llm_response = openai.chat.completions.create(
        model="gpt-4o",
        messages=[{"role": "user", "content": f"Based on the following information: {index_response}, answer the question: {query}"}],
        max_tokens=150
    )

    return llm_response.choices[0].message.content.strip()

# Example query
response = query_with_llm("What are the company’s key values?")
print(response)

